import FormStyles from './styles/Form';

export default function SignIn() {
  return (
    <FormStyles method="POST">
      <fieldset>
        <label>
          Email
          <input
            type="email"
            name="email"
            placeholder="email"
            autoComplete="email"
          />
        </label>
      </fieldset>
    </FormStyles>
  );
}
